svg.script:
var f1 = document.getElementById('f1')
var f2 = document.getElementById('f2')
var f3 = document.getElementById('f3')
var f4 = document.getElementById('f4')
var f5 = document.getElementById('f5')
var f6 = document.getElementById('f6')

var animate = function(now,time,end) {
  return function(){
    now();
    setTimeout(end,time);
  }
}

var ds = function(el,st){
  return function(){
    el.style.display = st;
  }
}
var playit = function() {

  animate(
    ds(f1,'block'),
    500,
    animate(
      ds(f2,'block'),
      500,
      animate(
        ds(f3,'block'),
        500,
        animate(
          ds(f4,'block'),
          500,
          animate(
            ds(f5,'block'),
            500,
            animate(
              ds(f6,'block'),
              500,
              function(){
                ds(f1,'none')();
                ds(f2,'none')();
                ds(f3,'none')();
                ds(f4,'none')();
                ds(f5,'none')();
                ds(f6,'none')();
                playit();
              }
            )
          )
        )
      )
    )
  )()
}
playit();
